DROP TABLE IF EXISTS `weme_loginlog`;

CREATE TABLE `weme_loginlog` (
  `loginid` int(11) NOT NULL AUTO_INCREMENT COMMENT '日志ID',
  `username` varchar(30) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '登录帐号',
