  `info` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '0' COMMENT '其他说明',
  PRIMARY KEY (`loginid`)
) ENGINE=InnoDB AUTO_INCREMENT=114 DEFAULT CHARSET=gbk COMMENT='后台登陆日志表';

