/*Table structure for table `weme_member` */

DROP TABLE IF EXISTS `weme_member`;

CREATE TABLE `weme_member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '用户名',
  `password` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '登录密码',
  `paypassword` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '支付密码',
  `nickname` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '昵称',
  `realname` char(20) COLLATE utf8_bin DEFAULT NULL COMMENT '真实姓名',
  `idcard` char(18) COLLATE utf8_bin DEFAULT NULL COMMENT '身份证',
  `phone` char(11) COLLATE utf8_bin DEFAULT NULL COMMENT '手机',
  `email` char(100) COLLATE utf8_bin DEFAULT NULL COMMENT '邮箱',
  `head` char(100) COLLATE utf8_bin DEFAULT NULL COMMENT '头像',
  `sex` tinyint(1) DEFAULT '0' COMMENT '性别 1男 2女 0未知',
  `birthday` char(50) COLLATE utf8_bin DEFAULT NULL,
  `email_status` tinyint(1) DEFAULT '0' COMMENT '邮箱认证 1认证 0未认证',
  `phone_status` tinyint(1) DEFAULT '0' COMMENT '手机认证 1认证 0未认证',
  `realname_status` tinyint(1) DEFAULT '0' COMMENT '实名认证 1认证 0未认证 ',
  `job_status` tinyint(1) DEFAULT '0' COMMENT '工作认证 1认证 0未认证',
  `income_status` tinyint(1) DEFAULT '0' COMMENT '收人认证 1认证 0未认证',
  `driving_status` tinyint(1) DEFAULT '0' COMMENT '机动车认证 1认证 0未认证',
  `pay_status` tinyint(1) DEFAULT '0' COMMENT '汇付天下账户认证 1认证 0未认证',
  `UsrId` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '汇付托管账户',
  `UsrCustId` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '汇付专属客户号',
  `reg_time` int(15) DEFAULT NULL COMMENT '注册时间',
  `lastlogin_time` int(15) DEFAULT NULL COMMENT '最后登录时间',
  `lastlogin_ip` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '最后登录IP',
  `login_num` int(15) DEFAULT '0' COMMENT '登录次数',
  `verify` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '证验码',
  `status` tinyint(1) DEFAULT '1' COMMENT '禁用 0禁用 1未禁用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='会员表';

/*Data for the table `weme_member` */

/*Table structure for table `weme_member_info` */

DROP TABLE IF EXISTS `weme_member_info`;

CREATE TABLE `weme_member_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) unsigned DEFAULT NULL COMMENT '用户ID',
  `education` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '学历',
  `school` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '毕业学校',
  `marital` int(2) DEFAULT '2' COMMENT '婚姻状况 1已婚 0未婚 2其他',
  `address` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '地址',
  `companyindustry` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '公司行业',
  `companyscale` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '公司规模',
  `position` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '职位',
  `income` char(50) COLLATE utf8_bin DEFAULT NULL COMMENT '收入',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='会员信息表';

